import PropTypes from 'prop-types';
import classNames from 'classnames/bind';

function Menu({ children}) {
    return ( 
        <nav className={cx('wapper-top')}>
            {children}
        </nav>
     );
}

Menu.propTypes = {
    children : PropTypes.node.isRequired,
};

export default Menu;
